import { Injectable } from '@angular/core';
import { Course } from '../model/course';
import{HttpCliente}

@Injectable({
  providedIn: 'root'
})
export class CoursesService {

  constructor(private httpClient: HttpCliente) { }

  list(): Course[]
  {
    return [
      {
      _id:'1', name:'Programação', category: 'TI'}
    ] 
  }

}
